const Container = styled.div`
    border: 1px solid black;
    width: 100%;
    max-width: 200px;
    height: 200px;
    flex-direction: column;
    justify-content: center;
    justify-items: center;
    align-items: center;
    align-content: center;
    margin: 0 auto;
    transition: .5s;

    .slick-slide {
        transition: 0.5s;
    }

    .slick-current {
        transform: scale(1.5);
        background-color: red;
    }
`

export default function ItemQuickView() {
    return <Container>
        Test
    </Container>
}
